import React from "react";
import "./buttons.css";
import { Link } from "react-router-dom";

function Nave() {
  return (
    <>
      <Link to="/" className="button">
        Home
      </Link>
      <Link to="https://github.com/Agus1510" className="button">
        GitHub
      </Link>
    </>
  );
}

export default Nave;
